import Navbar from './Navbar';

function About() {
  return (
    <div className="about-container">
      <Navbar />
      <h1>About Us</h1>
      <p>
        Welcome to our cute About Us page! We are a team of passionate individuals working together to create amazing things.
      </p>
    </div>
  );
}

export default About;
